import React from 'react'
import { useField } from 'formik'

export const TextField = (...props) => {
    const[field, meta] = useField(props);  // Argumento props (propriedades) com dados que retorna um elemento React
    return (
        <div>
            <input className="form-control" 
            {...props} 
            autocomplete="off"
            placeholder="E-mail"
            htmlFor={field.placeholder}
            />
           
        </div>
        
        
    )
}
